    false,nt"url": null,nt"notes": "RAIL_SYSTEM_INDOT_IN is a line shapefile
    that shows the 2006 rail system of Indiana. It is derived from data provided by
    personnel of the Indiana Department of Transportation (INDOT). Recent 2006 edits
    to this data set include removal of abandoned rail lines and inclusion of ownership
    changes. New attribute fields have been added by INDOT personnel to include items
    such as contact names, phone numbers, mailing addresses, and freight classifications.
    The following is excerpted from the metadata provided by INDOT, Office of Railroads,
    for the source shapefile named RAILROADS_TRAFFIC_2006.SHP: "RAILROADS_TRAFFIC_2006.SHP
    is a line shapefile delineating the railroad tracks within the State of Indiana.
    The dataset was generated at a scale of 1:1200."",nt"owner_org": "b0b4c45b-a8ca-416b-b463-ee90d0a1a3df",nt"extras":
